import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div className="App">
        <h1>Experts</h1>
        <header className="App-header">
          <p>
            DDD <code>src/App.js</code> and save to reload.
          </p>
          <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
          >
            Hamova - official
          </a>
        </header>
      </div>
  );
}

export default App;
